function deleteSatuanUnitDialog(el) {
    var data = $(el).data('detail');
    ConfirmMessage('Apakah Anda Yakin Akan Menghapus Data Ini?', isConfirm => {
        if (isConfirm) {
            var element = {
                tbody: '#SatuanUnit-tbody',
                tcontainer: '#SatuanUnit-table',
            };
            RequestData('DELETE', `/v1/SatuanJenis/delete/${data.Id}`, element.tcontainer, element.tbody, null, function (data) {
                if (data.Succeeded) {
                    ShowNotif("Data Deleted Successfully ...", "success");
                    getListSatuanUnit();
                } else
                    ShowNotif(`${data.Message} : ${data.Description}`, "error");
            });
        }
    });
}
